import React, { Component } from 'react';

import SearchField from 'react-search-field';

class App extends Component {
  render() {
    return (

		<SearchField 
		  placeholder='Search item'
		  classNames="test-class"
		  onChange={this.onChange}
		/>

    );
  }

  onChange = (value, evt) => {
	console.log(value);
  }

}

export default App;
